using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Api_savino_Filmes.Models;
using Microsoft.AspNetCore.Mvc;


namespace Api_savino_Filmes.Controllers
{
    [ApiController]
    [Route("/api/movies/")]
    public class MoviesController : ControllerBase
    {
        private static List<MovieModel> listaFilmes = new List<MovieModel>();

        [AcceptVerbs("POST")]
        [Route("CadastrarFilme")]
        public string CadastrarUsuario(MovieModel filme)
        {
            listaFilmes.Add(filme);
            return "Filme cadastrado com sucesso!";
        }
        [AcceptVerbs("PUT")]
        [Route("AlterarFilme")]
        public string AlterarFilme(MovieModel filme)
        {
            listaFilmes.Where(n => n.Id ==
            filme.Id)
            .Select(s =>
            {
                s.Name = filme.Name;
                s.Note = filme.Note;
                s.Author = filme.Author;
                s.Description = filme.Description;
                s.Genre = filme.Genre;
                return s;
            }).ToList();
            return "Filme alterado com sucesso!";
        }


        [AcceptVerbs("DELETE")]
        [Route("ExcluirFilme/{codigo}")]
        public string ExcluirFilme(int codigo)
        {
            MovieModel filme = listaFilmes.Where(n => n.Id == codigo)
            .Select(n => n)
            .First();
            listaFilmes.Remove(filme);
            return "Registro excluido com sucesso!";
        }
        [AcceptVerbs("GET")]
        [Route("ConsultarFilmePorCodigo/{codigo}")]
        public MovieModel ConsultarUsuarioPorCodigo(int codigo)
        {
            MovieModel filme = listaFilmes.Where(n => n.Id == codigo)
            .Select(n => n)
            .FirstOrDefault();
            return filme;
        }
        [AcceptVerbs("GET")]
        [Route("ConsultarFilmes")]
        public List<MovieModel> ConsultarFilmes()
        {
            CarregarFilmes();
            return listaFilmes;
        }
        private void CarregarFilmes()
        {
            listaFilmes.Clear();
            listaFilmes.Add(new MovieModel(1, "Pequena sereia", "Filme da disney da ariel", "Fantasia", 4.2, "Disney", "data:image/jpeg;base64,"));
            listaFilmes.Add(new MovieModel(2, "Garota Exemplar", "Filme estadunidense de suspense psicológico de 2014", "Suspense", 5, "David Fincher", "data:image/jpeg;base64,"));
            listaFilmes.Add(new MovieModel(3, "Esquadrão Suicida", "Filme norte-americano de super-herói de 2016, baseado na equipe de anti-heróis", "Acão", 3.2, "David Ayer", "data:image/jpeg;base64,"));
            listaFilmes.Add(new MovieModel(4, "Poderoso Chefão", "Filme norte-americano de 1972, baseado no livro homônimo escrito por Mario Puzo", "Drama", 5, "Francis Ford Coppola", "data:image/jpeg;base64,"));
            listaFilmes.Add(new MovieModel(5, "La La Land: Cantando Estações", "Filme que segue a história de um pianista de jazz e uma aspirante a atriz que se conhecem e se apaixonam em Los Angeles", "", 4.1, "Damien Chazelle", "data:image/jpeg;base64,"));
        }

    }
}
